INSERT INTO `dbo.Game_Map` VALUES (1001,'Cầu vồng','Một nơi thần kì, mọi thứ đều bí ẩn. Lão kình ngư khổng lồ giữa biển, áng mây ngũ sắc vòng quanh. Đâu đó vài chú hải cẩu vươn mình bên đàn cá. Kìa 1 đám mây hình con mực bị gió thổi lượn vòng quanh lão kình ngư ấy. Những cụm mấy hồng nhỏ bé cứ như đàn cá lượn lờ bơi. ',2000,1425,1526,1425,0,0,10,2,'fore','back','','test','','1001','864,391|1555,554|1084,563|378,393',3,'1803,395|1305,389|631,550|178,563'),(1002,'Đường bay ma quái','Chúng tôi đứng bên cột buồm nhìn xa xăm: Trên boong tàu đầy ắp châu báu của hải tặc.Toàn thứ quý hiếm. Lại còn có rượu thịt ê hề. Tôi vừa thấy bên thùng rượu là 1 bộ xương tay cầm kim bôi. Bánh lái khổng lồ, dây thừng chắc chắn. Những thứ này lại không quan trọng bằng việc bạn đánh bại được đối thủ, đây là chiến lợi phẩm và bạn đang lênh đênh trên biển, vượt qua thử thách trùng trùng.\r\n',1500,1000,1311,1000,0,0,10,2,'fore','back','','test','','1002','586,244|655,490|401,494|571,773',3,'875,240|852,751|882,484|1064,460'),(1003,'Công trường','Các kĩ sư của chúng ta đangkhẩn trương để kịp tiến độ công trình.Nán lại nơi này thì bảo đảm bạn sẽ bắt gặp vật thể lạ từ trên trời rơi xuống, nếu là UFO thì còn gì bằng. ',1272,950,1139,950,1272,950,10,2,'fore','back','dead','','','1003','280,598|388,398|394,802|506,598',2,'856,398|976,592|856,796|736,598'),(1004,'Lớp học ma thuật','Lớp học này có từ xa xưa, chế tác hoàn toàn từ gỗ, hầu như không thấy bạn nhỏ nào đến học. Bàn ghế, bảng đen, phấn viết lợi dụng lúc không người cãi nhau loạn xạ. Lại có nhiều sách ma thuật dày cộm, hình như đã rất lâu đời. Mấy tên người giấy thòi đầu ra khỏi bìa sách, khát khao tự do.  \r\n',1600,851,1369,851,0,0,10,2,'fore','back','','','','1004','265,596|103,652|568,481|435,523',3,'1497,624|1231,536|1067,529|1334,523'),(1005,'Rừng nhiệt đới','Rừng nhiệt đới sở hữu thảm thực vật vô cùng phong phú, với những cây dây leo chằng chịt và các loài cây cỏ to lớn. Tất cả tạo nên khu rừng kín bưng huyền bí, ẩm ướt và nguy hiểm. Thám hiểm rừng chớ áp sát cây rừng, cẩn thận lũ khỉ tinh nghịch.  ',1300,948,1138,948,0,0,10,2,'fore','back','','','','1005','940,657|809,636|481,667|342,649',3,'1231,671|1066,678|42,651|144,655'),(1006,'Đu quay','Nghe nói，đu quay chở trên mình niềm hạnh phúc. Chúng mình phải cùng người yêu dấu ngồi trên đu quay này, cùng nhau kiếm tìm hạnh phúc. Thật ra thì hạnh phúc cũng giống như đu quay, cứ mãi xoay tròn, không bao giờ ngừng quay...  ',2200,1278,1100,841,2200,1278,10,2,'fore','back','dead','','','1006','1533,370|2009,741|952,294|370,523',2,'1791,514|1236,296|622,385|159,755'),(1007,'Olympus','Olympus là thánh địa của các vị thần Hy Lạp. Olympus đi vào lòng người thể hiện ý chí đấu tranh vàsức mạnh phi thường, trở thành di sản văn hóa của lòai người đương đại. ',2000,900,1000,649,0,0,10,2,'fore','back','','','','1007','895,411|643,482|405,368|151,313',3,'1590,426|1338,370|1135,457|1830,321'),(1008,'Phố nấm lùn','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của niềm hạnh phúc. ——Chính là phố nấm lùn。Ở đây bạn có thể phát huy tiềm lực. Bạn muốn có sức mạnh không? Hãy dùng thực lực để phấn đấu nhé. ',2000,1194,1100,897,0,0,10,2,'fore','back','','','','1008','1591,705|1419,714|1742,540|1906,533',3,'591,717|244,536|383,703|95,532'),(1009,'Ba Tư huyền bí','“Ta，Vua Ba Tư, vua vĩ đại nhất mọi thời đại, con của cha ta, cháu của ông nội ta”. Dòng dõi quý tộc của ta sẽ mãi trường tồn. ',2300,1142,1000,796,0,0,10,2,'fore','back','','','','1009','2106,532|1800,413|1002,261|748,412',3,'1529,411|1262,264|475,410|150,531'),(1010,'Dạ đàm','Vùng đất này từ xưa đã là 1 thánh địa truyền thuyết. Nếu cùng các thiếu nữ xinh đẹp nơi đây 1 lần chạm mặt, bạn sẽ thấy cuộc đời đầy sinh lực và kì vọng. Những bảo vật đang cất giấu quanh đây cũng đang đi tìm chủ nhân xứng đáng.  \r\n',2800,1072,1100,629,0,0,10,2,'fore','back','','','','1010','1529,264|2058,243|2384,261|1676,512',3,'1112,518|398,259|1180,243|697,245'),(1011,'Thành ác ma','Bá tước Dracula, thích mùi máu tươi, sống trong lâu đài cổ kính, người thường không dám bén gót chân. Cẩn thận lũ quạ đen tinh quái luôn chực chờ móc mắt bạn.  ',2000,1040,1242,1040,0,0,10,2,'fore','back','','','','1011','393,773|511,775|1119,771|1232,769',3,'874,775|749,775|1592,773|1472,773'),(1012,'Đèn lồng vàng','Quê hương Giang Nam bình lặng, phong cảnh hữu tình khiến ai 1 lần đến sẽ rất khó quên. Bạn đã có duyên đến với nơi này sao không nán lại để cảnh đẹp thu vào trong kí ức. ',2692,1477,1100,916,0,0,10,2,'fore','back','','','','1012','2288,768|2093,768|1896,301|1670,281',3,'1041,292|785,284|615,777|373,777'),(1013,'Cố hương','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của người cây。Được người cây chúc phúc bạn tuyệt nhiên có thêm sức mạnh và luôn gặp nhiều may mắn. Bạn muốn có sức mạnh không? Hãy dùng thực lực mà phấn đấu nhé.',2300,1090,1100,675,0,0,10,2,'fore','back','','','','1013','150,747|309,742|1411,747|1609,742',3,'2010,746|2174,744|742,740|955,744'),(1014,'Bờ biển ngà','Trong các kì bình chọn hằng năm \" địa điểm đáng tham quan nhất\" thì bờ biển ngà luôn chiếm hạng cao trong top. Không chỉ vì phong cảnh đẹp mà còn vì nơi đây mang trên mình truyền thuyết về hải thần. Vũ khí tối thượng của ngài được dấu nơi đây. Có được nó bạn sẽ có sức mạnh phi thường. ',2106,1500,1100,1058,2106,1500,10,2,'fore','back','dead','','','1014','120,1294|380,1290|1188,1257|1455,1276',2,'656,1276|929,1256|1726,1289|2000,1292'),(1015,'Phố nấm lùn (nhỏ)','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của niềm hạnh phúc. ——Chính là phố nấm lùn。Ở đây bạn có thể phát huy tiềm lực. Bạn muốn có sức mạnh không? Hãy dùng thực lực để phấn đấu nhé. ',1500,896,1000,815,1500,896,10,2,'','back','dead','','','1008','430,400|430,400',2,'430,400|430,400'),(1016,'Ba Tư huyền bí (nhỏ)','“Ta，Vua Ba Tư, vua vĩ đại nhất mọi thời đại, con của cha ta, cháu của ông nội ta”. Dòng dõi quý tộc của ta sẽ mãi trường tồn. ',1610,799,1000,795,1610,799,10,2,'','back','dead','','','1009','134,458|361,481|504,460|651,480',3,'943,480|1090,458|1237,481|1454,455'),(1017,'Cố hương (nhỏ)','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của người cây。Được người cây chúc phúc bạn tuyệt nhiên có thêm sức mạnh và luôn gặp nhiều may mắn. Bạn muốn có sức mạnh không? Hãy dùng thực lực mà phấn đấu nhé.',1518,719,1000,612,1518,719,10,2,'','back','dead','','','1013','62,470|241,469|410,468|578,471',3,'927,469|1085,469|1233,467|1413,470'),(1018,'Lớp học ma thuật (nhỏ)','Lớp học này có từ xa xưa, chế tác hoàn toàn từ gỗ, hầu như không thấy bạn nhỏ nào đến học. Bàn ghế, bảng đen, phấn viết lợi dụng lúc không người cãi nhau loạn xạ. Lại có nhiều sách ma thuật dày cộm, hình như đã rất lâu đời. Mấy tên người giấy thòi đầu ra khỏi bìa sách, khát khao tự do.  ',1520,808,1000,621,1520,808,10,2,'','back','dead','','','1004','158,594|313,530|529,467|689,405',3,'1414,592|937,497|1110,504|1290,515'),(1019,'Đu quay (nhỏ)','Nghe nói，đu quay chở trên mình niềm hạnh phúc. Chúng mình phải cùng người yêu dấu ngồi trên đu quay này, cùng nhau kiếm tìm hạnh phúc. Thật ra thì hạnh phúc cũng giống như đu quay, cứ mãi xoay tròn, không bao giờ ngừng quay...  ',1540,895,1000,765,1540,895,10,2,'','back','dead','','','1006','103,519|237,594|403,669|611,704',3,'1451,516|1301,606|1146,669|946,705'),(1020,'Bờ biển ngà (nhỏ)','Trong các kì bình chọn hằng năm \" địa điểm đáng tham quan nhất\" thì bờ biển ngà luôn chiếm hạng cao trong top. Không chỉ vì phong cảnh đẹp mà còn vì nơi đây mang trên mình truyền thuyết về hải thần. Vũ khí tối thượng của ngài được dấu nơi đây. Có được nó bạn sẽ có sức mạnh phi thường. ',1351,962,1000,962,1351,962,10,2,'','back','dead','','','1014','1280,822|1104,822|420,812|590,800',3,'72,826|240,824|926,812|760,802'),(1021,'Cầu vồng (nhỏ)','Một nơi thần kì, mọi thứ đều bí ẩn. Lão kình ngư khổng lồ giữa biển, áng mây ngũ sắc 