|974,652|1251,652',3,''),(1075,'Hoàng cung','Sâu trong hoàng cung，các chiến sĩ chiến đấu với Vua Hihi, đây là cuộc chiến cuối cùng chăng?  Hay vẫn còn những trận chiến khác đang chờ. ',1500,800,1100,791,1500,800,10,2,'','back','dead','','','1075','123,681|341,681|513,681|708,681',3,''),(1076,'Đêm yên lành','Giáng sinh đến rồi, ai cũng muốn nhanh chóng về nhà, quây quần bên bếp lửa, nhìn lại 1 năm dài. Đó chính là hạnh phúc, là vận may. ',1784,992,1100,962,1784,992,10,2,'','back','dead','','','1076','97,709|289,697|1484,697|1676,709',3,''),(1078,'Hoàng cung VIP','Không ngờ các ngươi có thể chiến đấu đến giây phút này. Ta mộng tưởng chiếm lãnh vương quốc Gà. Tưởng rằng thế giới loài người cũng dễ dàng như vậy. Sức mạnh của các ngươi quả làm ta bất ngờ. Hôm nay ta sẽ cho các ngươi xem sức mạnh cuối cùng. Ta không để các ngươi thoát khỏi đâu. ',1800,1123,1100,874,0,0,10,2,'fore','back','','','','1078','191,343|110,637|305,625|614,674',3,'1596,343|1528,582|1334,721|1155,721'),(1082,'Cố hương','Đường hào kiệt công danh, bắt đầu từ cái chết. Nhìn cảnh lửa đạn, mấy ai hiểu được cuộc bể dâu.  ',1200,719,1060,719,1200,719,10,2,'','back','dead','','','1036','1335,537|1335,538',3,''),(1083,'Cầu không gian (nhỏ)','Mây trôi bồng bềnh cùng hơi thở của biển, khiến người ta cảm thấy thật sảng khoái như đang ở xứ sở thần tiên nghe nàng tiên biển cất tiếng hát. Bạn có muốn đua thuyền để đến nới đây không? ',2300,1090,1100,674,2300,1090,10,2,'','back','dead','','','1013','1335,537|1335,538',3,''),(1084,'Cầu không gian','Mây trôi bồng bềnh cùng hơi thở của biển, khiến người ta cảm thấy thật sảng khoái như đang ở xứ sở thần tiên nghe nàng tiên biển cất tiếng hát. Bạn có muốn đua thuyền để đến nới đây không? ~',1784,992,1100,960,1784,992,10,2,'','back','dead','','','1084','40,660|90,660|128,667|183,699',3,''),(1085,'Cố hương (nhỏ)','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của người cây。Được người cây chúc phúc bạn tuyệt nhiên có