'),(1091,'Phố nấm lùn (nhỏ)','Truyền rằng cùng trời cuối đất có 1 vùng đất lạ, nơi đó tuyệt nhiên không có đấu tranh, là quê hương của niềm hạnh phúc. ——Chính là phố nấm lùn。Ở đây bạn có thể phát huy tiềm lực. Bạn muốn có sức mạnh không? Hãy dùng thực lực để phấn đấu nhé. ',2100,817,1200,602,2100,817,10,2,'','back','dead','','','1024','229,420|386,492|555,535|762,553',2,'1315,553|1515,537|1700,496|1865,420'),(1092,'Xe lửa','Xe lửa trong thế giới Gunny di chuyển trên đường sắt, các GUILD vì muốn có vũ khí mạnh nhất lao vào cướp bóc. Trạm trưởng đã phát thông báo, kêu gọi mọi người tiếp viện. ',2396,1038,1100,624,2396,1038,10,2,'','back','dead','','','1025','1499,740|1737,764|1962,731|2210,765',3,'194,753|500,718|739,756|993,759'),(1093,'Thần miếu','Trong rừng sâu có ngôi thần miếu, nơi đây cất giấu  những câu chuyện thần kì của thế giới Gunny. Nhưng bây giờ ngôi miếu lại bị ma vương chiếm cứ. Các dũng sĩ hãy tiến lên chống lại ma vương.  ',2430,1134,1100,606,2430,1134,10,2,'','back','dead','','','1026','542,888|1260,886|1568,888|2054,886',2,'746,890|1034,882|1774,892|2280,880'),(1094,'Halloween','Truyền rằng Halloween năm nào, Ma Vương xuất hiện, biến dân làng thành đá, từ đó xuất hiện trấn ma quỷ này. ',2898,1283,1100,650,2898,1283,10,2,'','back','dead','','','1027','62,567|303,583|571,573|798,629',3,'1881,642|2184,606|2473,573|2694,586'),(1095,'Thành hải tặc','Âm mưu thâm độc của Imhotep dẫn đến tai họa cho 3000 năm sau. Các chiến sĩ phải ngăn chặn Imhotep hồi sinh thống lĩnh đạo quân bất tử. ',2406,800,1400,608,2406,800,10,2,'','back','dead','','','1029','190,622|413,597|782,543|1088,568',3,'2296,544|2083,582|1769,575|1497,611'),(1096,'Chiến hào','Giữa đống hoang tàn mịt mù khói súng, thấm đượm màu sắc của chiến tranh và chết chóc. Các chiến sĩ hãy dũng cảm chiến đấu để dành lại hòa bình. ',2428,1253,1100,919,2428,1253,10,2,'','back','dead','','','1031','807,844|591,917|55,897|342,928',3,'1747,935|1495,776|1994,929|2270,899'),(1097,'Động Huyền Vũ','Truyền rằng tứ đại linh thú: Huyền Vũ đã xuất hiện nơi đây. Vì chiêm bái Huyền Vũ, các chiến sĩ Gunny từ sáng tới chiều túc trực nơi đây. Có bạn vì dành chỗ mà đánh nhau.  ',2499,1239,1100,858,2499,1239,10,2,'','back','dead','','','1032','149,803|397,838|582,745|863,729',3,'1612,722|1909,745|2088,837|2335,804'),(1098,'Xương rồng viễn tây','Các bạn xương rồng xưa nay đã sống ở nơi này. Chúng mình phải yêu quý và bảo vệ. ',2192,1651,1100,964,2192,1651,10,2,'','back','dead','','','1028','112,1333|355,1295|525,1247|728,1225',3,'1430,1225|1673,1260|1853,1295|2027,1333'),(1099,'Maya hoang tàn','Văn hóa Maya 1 thời hưng thịnh, nay bị vùi chôn dưới lòng đất. Bạn muốn mục thị di tích cổ đại này không? ',2500,1156,1100,683,2500,1156,10,2,'','back','dead','','','1033','93,551|266,605|1585,740|1776,696',2,'902,742|698,694|2169,598|2363,549'),(1100,'Mộc Diệp trấn','Đường hào kiệt công danh, bắt đầu từ cái chết. Nhìn cảnh lửa đạn, mấy ai hiểu được cuộc bể dâu. ',1400,1800,1100,1553,1400,1800,10,2,'','back','dead','','','1034','90,1162|258,1212|402,1277|525,1295',3,'834,1297|1001,1284|1138,1212|1252,1151'),(1101,'Cầu vận hà','Thành phố lớn lúc nào cũng bận rộn và náo nhiệt. Nhưng bên cạnh âm thanh huyên náo của xe cộ, người ta chợt bắt gặp hình ảnh hữu tình của mấy chú chim nhỏ đang ríu rít trên dây điện, gợi nhớ 1 thời tuổi thơ yên bình.  ',1982,1069,1100,727,1982,1069,10,2,'','back','dead','','','1035','288,883|460,836|642,786|760,718',3,'1204,708|1338,784|1486,838|1650,866'),(1102,'Ưu linh quỷ thành','Đến nơi nay tôi có cảm giác tối tăm lắm, rờn rợn. Khát khao một tia nắng ấm. Dưới chân tôi lạo xạo tiếng xương người vụn nát. Tôi không muốn bị biến thành bộ xương khô khốc. Tôi phải rời khỏi đây ngay.',2050,1100,1100,654,2050,1100,10,2,'','back','dead','','','1037','82,757|231,736|1306,696|1434,704',3,'600,715|761,702|1798,741|1932,758'),(1103,'Cối xay gió','Nhà tranh, cối xay gió, guồng quay nước.. Ôi phong cảnh đẹp như tranh. ',2100,1515,1100,932,2100,1515,10,2,'','back','dead','','','1038','86,1041|250,1102|394,1141|646,1217',3,'1325,1223|1550,1184|1775,1128|1946,1062'),(1104,'Vườn yêu','Hương sen kính phật, thiếu nữ lả lướt yếm đào khiêu vũ trong gió. Vài giọi sương còn đọng long lanh trên lá sen xanh mướt. Như cảnh thần tiên. Bạn sẵn lòng cùng tôi ngao du không chứ? ',1317,992,1100,981,1317,992,10,2,'','back','dead','','','1040','279,614|413,756|145,529|40,539',3,'1276,542|1177,526|903,754|1022,616'),(1105,'Vườn hoa','Sống trong thế giới hoa, phải chăng bạn đang có cảm giác như đang sống tại thế giới thần tiên. ',2100,1281,1100,888,2100,1281,10,2,'','back','dead','','','1059','174,923|419,943|573,974|735,974',3,'1279,952|1498,943|1685,965|1929,902'),(1106,'Lớp học ma thuật','Lớp học này có từ xa xưa, chế tác hoàn toàn từ gỗ, hầu như không thấy bạn nhỏ nào đến học. Bàn ghế, bảng đen, phấn viết lợi dụng lúc không người cãi nhau loạn xạ. Lại có nhiều sách ma thuật dày cộm, hình như đã rất lâu đời. Mấy tên người giấy thòi đầu ra khỏi bìa sách, khát khao tự do.  ',1728,1205,1100,982,1728,1205,10,2,'','back','dead','','','1060','103,752|359,928|524,952|674,994',3,'1003,984|1150,955|1353,928|1463,851'),(1107,'Rừng nhiệt đới','Rừng nhiệt đới sở hữu thảm thực vật vô cùng phong phú, với những cây dây leo chằng chịt và các loài cây cỏ to lớn. Tất cả tạo nên khu rừng kín bưng huyền bí, ẩm ướt và nguy hiểm. Thám hiểm rừng chớ áp sát cây rừng, cẩn thận lũ khỉ tinh nghịch.  ',1600,851,1100,684,1600,851,10,2,'','back','dead','','','1004','265,596|103,652|568,481|435,523',3,'1497,624|1231,536|1067,529|1334,523');
