INSERT INTO `dbo.Lightriddle_Quest` VALUES (1,'Nơi cao 1000m, có khí hậu lạnh ở đâu ?','Sapa','Đà Lạt','Hà Nội','Đà Nẵng',1),(2,'Festival hoa diễn ra ở Thành Phố nào ?','Quảng Ninh','Hà Nội','Đà Lạt','Tp.Hcm',3),(3,'Cách ủi quần áo nào sai?','Xịch nước trước khi ủi','Ủi thật lâu','Nhiệt độ thích hợp','Lót vải ướt giữa quần áo và bàn ủi',4),(4,'Cung điện hoàng gia đẹp ở Pháp tên gì ?','Cố Cung','Versailles','Điện Elysee','Điện Kremli',2),(5,'Thủ đô nằm gần cực bắc nhất:','Stockholm','Iceland','Reykjavik','Copenhagen',2),(6,'Liên hoan phim Cannes tổ chức ở nước nào?','Pháp','Ý','Anh','Đức',1),(7,'Trong gốm sứ truyền thống không có màu nào?','Lục','Vàng','Đỏ','Đen',3),(8,'Dãy núi dài nhất thế giới:','Pyrenees','Himalayas','Andes','Kilimanjaro',3),(9,'Ai có biệt hiệu là Lục Nhất Cư Sĩ?','Âu Dương Tu','Đường Bá Hổ','Liễu Á Tử','Tô Mạn Thù',2),(10,'Kênh đào Suez thuộc quốc gia nào?','Israel','Palestine','Jordan','Ai Cập',4),(11,'Hành tinh lớn nhất trong Hệ Mặt Trời:','Sao Thổ','Sao Mộc','Sao Hỏa','Sao Hải Vương',2),(12,'Hổ là một loài động vật thuộc họ mèo gì ?','Tgris','Felidae','Panthera','Cat',2),(13,'Trong Tây Du Ký, tên thật của Đường Tam Tạng là:','Huyền Từ','Huyền Minh','Đường Tăng','Huyền Trang',4),(14,'Vòng tròn màu đen trên lá cờ Olympic tượng trưng c','Châu Mỹ','Châu Âu','Châu Phi','Châu Á',3),(15,'Phong tục cưới đặc sắc của dân tộc người nào ?','Dân tộc Thái','Dân tọc Dao Tuyển','Dân tộc Choang','Dân tộc Hồi',2),(16,'Hồ Ngọc Hà thuộc ngành gì trong showbiz Việt ?','Diễn Viên','Người mẫu','Ca sĩ','Nhạc sĩ',3),(17,'Which is the mascot of AIG 3 ','Mouse','Chicken','Phone','Chopin',2),(18,'“Tóc để chỏm” dùng để chỉ: ','Nhi đồng','Thiếu niên','Trung niên','Người già',1),(19,'Bướm phát hiện mật hoa nhờ:','Nhìn thấy','Chân trước chạm vào','Ngửi thấy','Nếm được',3),(20,'Thành phố này được giải phóng ngày 29/03/1975 ?','Tp.Hcm','Hà Nội','Đà Nẵng','Hải Phòng',3),(21,' “Lưỡng quốc tướng quân” của Việt Nam là ai? ','Nguyễn Bá','Nguyễn Huệ','Nguyễn Hào','Nguyễn Sơn',4),(22,' Ai phát minh ra cột thu lôi : ','Franklin( năm 1750)','Franklin( năm 1751)','Franklin( năm 1752)','Franklin( năm 1753)',3),(23,' Nhân vật được Bác Hồ nhắc đến trong “Vi hành” ?','Đài Bắc','Khải Định','Hoa Sơn','Công Tránh',2),(24,'Tác phẩm đoạt giải Nobel của Hemingway năm 1954 ','Cát Lâm','Cáp Nhĩ Tân','Ông già và biển cả','Mẫu Đơn Giang',3),(25,'Bài thơ “Nắng mới” của Lưu Trọng Lư viết về ai','Người yêu','Cháu','Cha','Mẹ',4),(26,'Nguyên tố có nghĩa là “Mặt trời” ','H2O','Heli','H2','O2',2),(27,'Khí cười là khí gì ','O2','N2O','N2','O',2),(28,'Nam Đồng Thư Xã là tiền thân của tổ chức nào ? ','Việt Nam cường quốc','Việt Nam Quốc dân Đảng','Việt Nam đảng','Việt Nam',2),(29,'Đàn violin có mấy dây?','2','3','4','6',3),(30,'Cầu Tràng Tiền được xây dựng dưới triều vua nào ? ','Vua Thanh Thái','Trần Nhân Tông','Trần Quốc Toản','Trần Bá Dũng',1),(31,'Ải Chi Lăng thuộc tỉnh nào của nước ta ?','Thanh Hóa','Lạng Sơn','Huế','Vinh',2),(32,'Câu thơ “Xuân phong bất độ Ngọc Môn quan” của thi ','Lý Bạch','Đỗ Phủ','Lý Thanh Chiếu','Vương Chi Hoán',3),(33,'Món nào là đặc trưng của Hồ Nam?','Thịt lừa','Đậu phụ cứng','Giò hun khói','Gà con',4),(34,'Môi trường sinh thái bị đe dọa nghiêm trọng do con','Lười biếng','Hay quên','Lãng phí','Tham ăn',4),(35,'“Kỳ” trong “Cầm kỳ thi họa” là:','Cờ tướng','Cờ vây','Cờ tướng cổ','Cờ tướng quốc tế',2),(36,'Ngân Hàng Nông Nghiệp Trung Quốc phát hành thẻ tín','Trường Thành','Bông Lúa Vàng','Mẫu Đơn','Rồng',2),(37,'Từ “Mao lư” trong “Sơ xuất mao lư” chỉ nơi ở của a','Gia Cát Lượng','Tư Mã Thiên','Tư Mã Quang','Lưu Bị',2),(38,'Hệ thống thông tin toàn cầu được gọi là:','Internet','Server','LAN','Máy tính',2),(39,'Nam Nhạc trong Ngũ Nhạc chính là:','Hành Sơn','Hằng Sơn','Thái Sơn','Hoa Sơn',3),(40,'Quê hương của Bồ Tùng Linh:','Sơn Đông','Giang Tô','Hà Bắc','An Huy',4),(41,'“Thương hải” trong “Thương hải tang điền” là:','Đông Hải','Nam Hải','Hoàng Hải','Bột Hải',3),(42,'Cờ lục quân có bao nhiêu con?','50','60','40','70',1),(43,'Tuổi của mặt trời?','3 tỷ năm','5 tỷ năm','8 tỷ năm','10 tỷ năm',3),(44,'Thành ngữ nào không chính xác:','Áo ấm cơm no','Bụng làm dạ chịu','Ăn miếng trả miếng','Cáo mượn oai gà',2),(45,'World Cup lần đầu tiên tổ chức ở đâu?','Uruguay','Mexico','Argentina','Ý',4),(46,'Năng lượng sạch nhất:','Dầu mỏ','Năng lượng mặt trời','Khí ga','Khí đốt',2),(47,'Bạch Quả thuộc dạng quả gì?','Quả cứng','Quả mềm','Quả hạch','Quả kép',1),(48,'Tại sao mũi chó thường ẩm ướt?','Tế bào khứu giác tiết ra dịch nhờn','Hay uống nước','Sổ mũi','Liếm mũi',1),(49,'Câu chuyện “Tam cố mao lư” nói về:','Lưu Bị thăm Gia Cát Lượng','Lưu Bị thăm Quan Vũ','Tào Tháo thăm Hứa Du','Tôn Quyền thăm Chu Du',4),(50,'Nhà máy phát điện hạt nhân đầu tiên của Trung Quốc','Vịnh Daya','Thái Sơn','Ling Ao','Tianwan',4),(51,'Điệu nhảy yêu thích của người Brazil:','Waltz','Samba','Tango','Tap Dance',2),(52,'Bài thơ nào thể hiện ý nguyện ẩn cư','Vịnh Kinh Kha-Đào Uyên Minh','Sơn Cư Thu Minh-Vương Duy','Dạ Trung Bất Năng Mị-Nguyễn Tịch','Sơn Trung Quả Phụ-Đỗ Tuân Hạc',1),(53,'Sai lầm khi sử dụng bình chữa cháy:','Đứng nơi đầu gió','Cách thật xa ngòi lửa','Nhắm xịt vào ngòi lửa','Nhắm xịt vào ngọn lửa',2),(54,'Nước có diện tích lớn nhất thế giới:','Canada','Nga','Trung Quốc','Mỹ',4),(55,'Nhẫn Định Tình nhận được khi cử hành hôn lễ có thể','30 ngày','7 ngày','365 ngày','Vĩnh viễn',4),(56,'Có thể tăng thuộc tính nào cho Đá Thanh Long?','Tấn công','Nhanh nhẹn','Phòng thủ','May mắn',1),(57,'Có thể tăng thuộc tính nào cho Đá Bạch Hổ?','May mắn','Tấn công','Nhanh nhẹn','Phòng thủ',2),(58,'Có thể tăng thuộc tính nào cho Đá Chu Tước?','Phòng thủ','May mắn','Tấn công','Nhanh nhẹn',3),(59,'Có thể tăng thuộc tính nào cho Đá Huyền Vũ?','Nhanh nhẹn','Phòng thủ','May mắn','Tấn công',4),(60,'Lựu Đạn mạnh về thuộc tính nào?','Tấn công','Phòng thủ','Nhanh nhẹn','May mắn',2),(61,'Sấm Sét mạnh về thuộc tính nào?','Tấn công','Phòng thủ','Nhanh nhẹn','May mắn',4),(62,'Phi Tiêu mạnh về thuộc tính nào?','Tấn công','Phòng thủ','Nhanh nhẹn','May mắn',3),(63,'Pháo mạnh