INSERT INTO `dbo.Pve_Info` VALUES (1,'\'Lâu đài Gà',4,14,'11025,11002,11006,11010,11014,313201,313102,313107,313108,312101,312102,312111,311101,311103,311121,11001,11005,11009,11013','17003,11025,1165,11003,11007,11011,11015,313203,313204,313109,312203,312204,312113,311205,311123,11002,11006,11010,11014','17001,11025,1166,3149,1165,11037,11039,11045,20104,20105,20106,11004,11008,11012,11016,313211,313212,313305,313306,312215,312307,311224,311307,11003,11007,11011,11015','7024,17002,17004,11025,5150,1166,3149,1165,20104,20105,20106,20107,311329,11037,313305,11039,313311,11045,312306,312315,311311,311328,11004,11008,11012,11016,11003,11007,11011,11015','1072','\'Lâu đài Gà　  Số người:2-4 người \n\n　　Tại một hòn đảo màu mỡ mang tên Porti, có một sinh vật hiền hòa yêu hòa bình gọi là Gà. 3 năm trước, một đế quốc hung hăng đã xâm lấn và thực hiện cuộc chiến tranh tàn khốc chưa từng có. Đức vua vương quốc Gà lãnh đạo nhân dân đánh đuổi bọn xâm lăng, nhưng những đòn tấn công hung hãn đã đẩy lùi Gà…\n\n　　Nhưng vài tháng trước xảy ra một thay đổi lạ lùng, kẻ xâm lăng bỗng nhiên ngừng tấn công, dần dần rút khỏi đáo Porti. Ngay lúc mọi người tưởng chừng vương quốc Gà thoát nạn,  thì một bộ tộc Gà tiến hành cuộc tấn công đến vùng đất hạnh phúc của loài người. Từng đoàn từng đoàn quân Gà ồ ạt tấn công. Các dũng sĩ được triệu tập khẩn cấp để ứng chiến. Xem ra đây có thể là một âm mưu có từ lâu…','GameServerScript.AI.Game.GuluKingdomSimpleGame','GameServerScript.AI.Game.GuluKingdomNormalGame','GameServerScript.AI.Game.GuluKingdomHardGame','GameServerScript.AI.Game.GuluKingdomTerrorGame',3,'14-16|16-18|18-23|23','','','500|1000|2000|3000'),(2,'Huyệt Ma Kiến',4,8,'11025,11002,11006,11010,11014,313101,313102,312101,312102,311101,311103,11001,11005,11009,11013','11025,313107,312109,311118,20101,20102,20103,11002,11006,11010,11014,313101,312101,11001,11005,11009,11013','','','1077','Huyệt Ma Kiến　  Số người:2-4 người \n\n    Ải viễn chinh là đầu mối liên thông quan trọng, là nơi tập trung các thương gia trên khắp thế giới. Gần đây rất nhiều thương nhân đi vào khu rừng ma pháp đều bị thế lực đen tối cướp hết hàng hóa. Đích thân Hội trưởng hội thương nghiệp tại Ải Viễn Chinh chiêu mộ dũng sĩ tiến vào khu rừng ma pháp trừ diệt yêu ma.\n\n    Dũng sĩ tứ phương tập hợp tiến vào rừng, khu rừng yên ắng, cứ như không có chuyện gì xảy ra. Họ đâu ngờ trong cánh rừng sâu thẩm kia có cặp mắt đang quan sát họ.','GameServerScript.AI.Game.AntCaveSimpleGame','GameServerScript.AI.Game.AntCaveNormalGame','','',1,'8-12|12-15','','','500|1000|0|0'),(3,'Bộ lạc Tà thần',4,18,'','2131,313305,313306,313301,11003,313302,11007,313303,313304,11025,11011,311309,11015,311312,311316','5156,2131,313405,11037,313406,11041,11025,20108,20109,20110,20111,312304,313401,11004,313402,11008,313403,313404,11012,11016','7026,7024,17002,5156,2131,20108,20109,20110,20111,20112,313411,11025,313412,311329,11037,313407,11041,313408,313409,313410,11004,313311,313312','1072','Bộ lạc Tà thần   Số người:2-4 người    \nNgười quản lý cầu cảng rất thích đồ cổ, đặc biệt là đồ gốm lâu năm có hình dáng và hoa văn đặc biệt. Trong 1 lần động đất, cái bình gốm rơi vỡ ra, sau đó, khi ông dọn dẹp phát hiện ra bên trong các mãnh vỡ của bình gốm có bản đồ. Cảm thấy hứng thú, ông bèn ghép lại thì ra được bản đồ dẫn đến một hòn đảo. Sau bao ngày lênh đênh, con thuyền cập bến. Người quản lý bắt đầu chia tốp, các dũng sĩ tiến sâu vào rừng rậm rạp ba918t đầu cuiộc tìm kiếm...\n\n','','GameServerScript.AI.Game.EvilTribeNormalGame','GameServerScript.AI.Game.EvilTribeHardGame','GameServerScript.AI.Game.EvilTribeTerrorGame',4,'18-22|22-27|27-31|35','','','500|1000|2000|3000'),(4,'Pháo đài hắc ám',4,18,'','4143,11025,4244,313305,313306,313301,11003,313302,11007,313303,313304,11011,311309,11015,311312,311316','5178,5278,4143,313405,11037,313406,11025,20113,20114,20115,11043,312304,313401,11004,313402,11008,313403,313404,11012,11016','7027,7026,7024,17002,5290,5175,5178,5278,1295,4143,20113,20114,20115,20116,313411,1102