cript.AI.Game.GuluOlympicsNormalGame','GameServerScript.AI.Game.GuluOlympicsHardGame','GameServerScript.AI.Game.GuluOlympicsTerrorGame',7,'18-22|22-27|27-31|35','','','500|1000|2000|3000'),(7,'Giải cứu gà con ',4,9,'1325,1425,11025,11035,312201,312202,312203,11002,11006,11010,11014,313101,313102,312101,312102,311101,311103,11001,11005,11009,11013','5824,5710,1324,1424,11025,11035,11003,11007,11011,11015,311201,311203,311205,312109,312110,313107,313108,11002,11006,11010,11014,311101,311103,311104','1830,1730,5317,5422,1426,1326,4164,4265,20126,20127,20128,20129,11025,11035,311318,311320,11004,11008,11012,11016,313207,313208,312209,312210,11003,11007,11011,11015','','1072','Giải cứu gà con     Số người đề nghị: 2-4 người    \nTại 1 nông trại bình yên, đang sinh sống 1 đàn gà lương thiện, sống bình yên với con người. Bỗng 1 hôm xuất hiện 1 con gà mái xấu xí đần độn, phá tan sự yên tĩnh của nông trại. Từ ngày gà mái đến, 1 kế họach đen tối đựơc vạch ra:bắt cóc và gây ô nhiễm đàn gà trong nông trại, bất kể là gà còn trong trứng hay gà con hay gà trưởng thành. Sau khi đàn gà bị bắt và lây nhiễm thì trở nên điên cuồng.\nThời gian dần trôi,con người phát hiện ra đàn gà bị mắc bệnh qua những hành động kỳ quặc của đàn gà. Trứng gà thì biến thành màu xanh lá, những con gà mái vốn hiền lành thì chạy lăng xăng không ngừng, gà trống thì trở nên háu chiến, tấn công người trong nông trại.\nCuối cùng vào 1 ngày, đàn gà bắt đầu tấn công và lây bệnh cho các gia súc khác. Lúc này, con người quyết định hành động và tìm cách bắt kẻ lan truyền dịch bệnh_gà mái xấu xí. Đồng thời cứu những chú gà con dễ thương còn sót lại chưa mắc bệnh.\n\n','GameServerScript.AI.Game.RunRunChickenSimpleGame','GameServerScript.AI.Game.RunRunChickenNormalGame','GameServerScript.AI.Game.RunRunChickenHardGame','',2,'9-12|12-15|15-20','','','500|1000|1500|2000'),(8,'Đại Chiến RoBot',23,8,'11025,11002,11006,11010,11014,313201,313102,313107,313108,312101,312102,312111,311101,311103,311121,11001,11005,11009,11013',